import React from "react";
import "./CodeReview.css";

function Review() {
  return (
    <div className="container flex gap-[1rem] p-4">
      <div className=" relative basis-2/4 flex flex-col bg-black rounded-lg">
        <div className="code">Hello</div>
        <div className="absolute t-20 right-5 text-white bg-red-700 p-2 px-8 rounded-md cursor-pointer select-none">
          Review
        </div>
      </div>
      <div className="basis-2/4 flex flex-col bg-[#343434] rounded-md"></div>
    </div>
  );
}

export default Review;
